import React from "react";
import '../App.css';

class Home extends React.Component {

  render() {
    return (      
      <div>
        <h1>Imponderables of the Mind</h1>
        <div className="homepage">
          <p>take the test</p>
          <button className="btn btn-default" onClick={this.save}>Submit</button>
        </div>
      </div>
    );
  }
}

export default Home;
